import logo from './logo.svg';
import './App.css';




function App() {
  function retrieveMudlist() {
    var xhttp = new XMLHttpRequest();
    xhttp.open('GET', 'http://localhost:8080/mudlistapi/mudlistapi?action=getMudList');
    xhttp.send();
  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <button onClick={retrieveMudlist}>Retrieve Mudlist</button>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
